// export default 

export default function multiplicar(a, b) {
    return a * b;
}

export function dividir(a, b) {
    return a / b;
}

export var dias = ['Domingo', 'Lunes', 'Martes', 'Miércoles', 'Jueves', 'Viernes', 'Sábado'];

export function diasDeLaSemana(num) {
    return dias[num];
}

